import React from 'react'
import './projects.css'

const Projects = () => {

    const projects = [
        "Projects coming soon",
    ]

    return (
        <div className="project-box">
                {projects.map((project, key) => (
                    {project}
                ))}
        </div>
    )
}

export default Projects
